import React from 'react';
import Header from './components/Header'
import PortfolioMain from './components/PortfolioMain'
import Footer from './components/Footer'
import './App.css';

function App() {
  return (
    <div className="App">
      <Header className="App-header" />
      <PortfolioMain />
      <Footer />
    </div>
  );
}

export default App;
